import classes from './MarkedRecipe.module.css';

const MarkedRecipe = (props) => {
  return (
    <div className={classes.recipe}>
      <h3>{props.drinkName}</h3>
      <hr />
      <p>{props.bartender}</p>
      <p>{props.alcohol}</p>
    </div>
  );
};

export default MarkedRecipe;
